import React from 'react';
import Header from './components/Header'

function App() {
  return (
    <>
    <Header title="Weather App"/>
    <div className="contenedor-form">
      <div className="container">
        <div className="row">
          <div className="col m6 "></div>
        </div>
      </div>
    </div>
    </>
  );
}

export default App;
